  return (
    <>
      <div style={styles.textArea}>
        <p style={styles.numbers}>jfdl</p>
        <p style={styles.numbers}>jlas</p>
      </div>
    </>
  );
};

const styles = {
  textArea: {
    borderTopLeftRadius: '1rem',
    borderTopRightRadius: '1rem',
    background: '#A2A2BD',
    width: '100%',
    height: '25%'
  },
  numbers: {
    marginBlockStart: 0,
    marginBlockEnd: 0,
    margin: 0,
    textAlign: 'right',
    paddingRight: '10px'
  }
};

export default TextArea;
